import React, {useEffect, useState} from 'react'

function App(children) {

  const [backendData, setBackendData] = useState({})
  useEffect(() => {
    fetch("/api").then(
      res => res.json()
    ).then(
      data => {
        setBackendData(data)
      }
    )
  }, [])

  return (
    <div>
      <p>hellow world</p>
        {backendData.length > 0 ? (
          backendData.map((item, index) => <p key={index}>{JSON.stringify(item)}</p>)
        ) : (
          <p>Loading...</p>
        )}
      </div>
  )
}

export default App
